(1, 'হেমনগর বালিকা উচ্চ বিদ্যালয় ', 'শিক্ষা জাতির মেরুদন্ড', 'স্থাপিত-১৯৯৩', '১১৪২০৫', '', 'Logo.png', '', '০১৭২৫-৪২৮১৫০', 'hghs.tg@gmail.com', ' হেমনগর, গোপালপুর,টাঙ্গাইল ', 'http://www.hemnagargirlshighschool.edu.bd', 'হেমনগর বালিকা উচ্চ বিদ্যালয় ', 'সকাল ৯:৩০ থেকে বিকাল ৪:০০', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'হেমনগর বালিকা উচ্চ বিদ্যারয়টি হেমনগর ইউনিয়নের একমাত্র বালিকা বিদ্যালয়। যেটি হেমনগরের প্রাণকেন্দ্রে পল্লীরঘন নিবিড় ছায়াতলে হেমনগর জমিদার বাড়ীর পার্শ্বেই অবস্থিত। ১৯৯৩ সালে এলাকার কতিপয় বিদ্যোৎসাহী ব্যক্তিগনের ঐকান্তিক প্রচেষ্টায় প্রতিষ্ঠা লাভ করায় এলাকায় নারী শিক্ষার এক আলাদা সুযোগ সৃষ্টি হইয়াছে। বর্তমানে বিদ্যালয়ে বিজ্ঞান, মানবিক, ব্যবসায় শিক্ষা এবং কারিগরি শিক্ষা চালু আছে। বর্তমানে বিদ্যালয়টিতে ১৭ জন শিক্ষক/শিক্ষিকা ও কর্মচারী কর্মরত রয়েছে। জে,এস,সি/ এস,এস,সি এবং কারিগরি শাখার ফলাফল সন্তোসজনক। ', 'মিসেস হামিদা খাতুন', '+88০১৭২৫-৪২৮১৫০', 'bolbolibegum123.gmail.com', 'Head_Master1.jpg', 'Head_Master1.jpg', 'শিক্ষা সার্বজনীন এবং চলমান প্রক্রিয়া। এর আধুনিকায়ন, যুগোপযোগী ও উৎকর্ষ সাধনে I C T এর ভূমিকা অনস্বীকার্য। বর্তমান সরকার এর বাস্তবায়নে অত্যন্ত আন্তরিক এবং নিরলস প্রচেষ্টা চালিয়ে যাচ্ছেন। গ্লোবালাইজেশনের যুগে প্রতিটি শিক্ষা প্রতিষ্ঠানে  ডায়নামিক ওয়েব সাইট চালু এক যুগান্তকারী সিদ্ধান্ত। এটি শিক্ষাকে আরো একধাপ এগিয়ে নিয়ে যাবে। এতে শিক্ষা আরো চিত্তাকর্ষক হবে। আমি এর উত্তোরত্তর সাফল্য কামনা করি।', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
