(59, 'প্রতিষ্ঠাতার ইতিহাস', 'founder-history', NULL, 1, 0, 'হেমনগর বালিকা উচ্চ বিদ্যারয়টি হেমনগর ইউনিয়নের একমাত্র বালিকা বিদ্যালয়। যেটি হেমনগরের প্রাণকেন্দ্রে পল্লীরঘন নিবিড় ছায়াতলে হেমনগর জমিদার বাড়ীর পার্শ্বেই অবস্থিত। ১৯৯৩ সালে এলাকার কতিপয় বিদ্যোৎসাহী ব্যক্তিগনের ঐকান্তিক প্রচেষ্টায় প্রতিষ্ঠা লাভ করায় এলাকায় নারী শিক্ষার এক আলাদা সুযোগ সৃষ্টি হইয়াছে। বর্তমানে বিদ্যালয়ে বিজ্ঞান, মানবিক, ব্যবসায় শিক্ষা এবং কারিগরি শিক্ষা চালু আছে। বর্তমানে বিদ্যালয়টিতে ১৭ জন শিক্ষক/শিক্ষিকা ও কর্মচারী কর্মরত রয়েছে। জে,এস,সি/ এস,এস,সি এবং কারিগরি শাখার ফলাফল সন্তোসজনক। ', '1450934753', 0, 1, 1),
(60, 'সাবেক প্রধান শিক্ষকের তালিকা', 'xheadteacher', NULL, 1, 0, '', '1450934458', NULL, 1, 1),
(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 21, 0, 'শিক্ষা সার্বজনীন এবং চলমান প্রক্রিয়া। এর আধুনিকায়ন, যুগোপযোগী ও উৎকর্ষ সাধনে I C T এর ভূমিকা অনস্বীকার্য। বর্তমান সরকার এর বাস্তবায়নে অত্যন্ত আন্তরিক এবং নিরলস প্রচেষ্টা চালিয়ে যাচ্ছেন। গ্লোবালাইজেশনের যুগে প্রতিটি শিক্ষা প্রতিষ্ঠানে  ডায়নামিক ওয়েব সাইট চালু এক যুগান্তকারী সিদ্ধান্ত। এটি শিক্ষাকে আরো একধাপ এগিয়ে নিয়ে যাবে। এতে শিক্ষা আরো চিত্তাকর্ষক হবে। আমি এর উত্তোরত্তর সাফল্য কামনা করি।', '1450938847', 0, 1, 1),
